import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import FileStructure from './FileStructure';

function HomePage() {
    const [showDiv, setShowDiv] = useState(false);

    const palleteIconClasses = ['glyphicon glyphicon-plus', 'glyphicon glyphicon-minus', 'glyphicon glyphicon-edit', 'glyphicon glyphicon-trash'];

    const palatteIcon = (iconClass) => {
        return (
            <div className='palatte-icon'>
                <button type="button" className="btn btn-default btn-sm">
                    <span className={iconClass}></span>
                </button>
                <hr />
            </div>
        );
    }

    const divStyle = {
        display: showDiv ? 'block' : 'none',
        backgroundColor: '#f0f0f0',
        padding: '20px',
        marginTop: '20px',
    };

    return (
        <>
            <div>
                <p className="top-text">Job</p>
                <div className="parent d-flex">
                    <div className="palatte-area">
                        <FileStructure />
                    </div>
                    <div className='content-area flex-grow-1'>
                        <div className='icons d-flex flex-column align-items-start'>
                            {palleteIconClasses.map((iconClass, index) => (
                                <div key={index}>
                                    {palatteIcon(iconClass)}
                                </div>
                            ))}
                        </div>
                        <div className='task d-flex mt-3'>
                            <button className="btn btn-outline-secondary mr-2">Status</button>
                            <button className="btn btn-outline-secondary mr-2">Setup</button>
                            <button className="btn btn-outline-secondary mr-2">Namelists</button>
                            <button className="btn btn-outline-secondary mr-2">Output</button>
                            <button className="btn btn-outline-secondary">Plots</button>
                        </div>
                    </div>
                </div>
            </div>
        </>
    );
}

export default HomePage;
